import {
    OwpTextField,
    OwpButton,
    OwpDialog,
} from 'owp/wrapper';
import React, { Component } from 'react';
import Formsy from 'formsy-react';
import { mutate, query } from 'owp/api';
import { debounce, isEmpty } from "lodash";
import * as TGEvent from 'owp/TGEvent';
import OwpPresetAutocompleteTextField from "owp/components/Form/OwpPresetAutocompleteTextField";
class DialogReweighing extends Component {
    constructor(props) {
        super(props);
        this.owpDialog = React.createRef();
        this.clickCreate = this.clickCreate.bind(this);
        this.onSave = this.onSave.bind(this);
        this.state = {
            FLAG: 'Y',
            firstMenu: '',
            secondMenu: '',
            thridMenu: ''
        };
    }

    handleChange = (event) => {
        this.setState({ [event.target.name]: event.target.value });
    };

    

    // 등록 화면 닫기
    createDialogClose = () => {
        this.setState({ createDialogOpen: false, firstMenu: '', secondMenu: '', thridMenu:'' });
        this.owpDialog.handleClose();
    };

    // 등록 확인 화면 열기
    createCheckOpen = () => {

        this.setState({ createCheckOpen: true });
        this.setState({ popMessage: '저장하시겠습니까?' });
    };

    // 등록 확인 화면 닫기
    createCheckClose = () => {
        this.setState({ createCheckOpen: false });
    };

    
    onSave = async (type) => {
        const data = {
            cudtype: 'create',
            'IPX_MULTYLANG.PAGEID' : this.state.PAGEID,
            'IPX_MULTYLANG.LANGEN' : document.getElementById("LANGEN").value,
            'IPX_MULTYLANG.LANGKR' : document.getElementById("LANGKR").value,
            'IPX_MULTYLANG.LOGSEQ' : document.getElementById("LOGSEQ").value,
            'IPX_MULTYLANG.FLAG' : 'Y',
            'IPX_MULTYLANG.LANGID' : document.getElementById("LANGID").value,
            'IPX_MULTYLANG.WUSERSEQ' : "1"
            
        };

        const result = await mutate({
            url: '/createIpxMultylang',
            data,
        })
        .then(res => {
            const G = TGEvent.getGridByID("C806000")
            G.ReloadBody()
            this.createDialogClose()
           
        })
        .catch(error =>{
           console.error(error);
        })
            
    };

    clickCreate() {
        this.onSave('START');
    }

    onSearchScreenID = (inputValue) => {
    
        query({
            url: "listOwpScreenID",
            params: {
                jsondata: JSON.stringify({
                    "IPX_COMMONCODE.CODEID": inputValue,
                  }),
               
            },
          }).then(res => {
            if(!isEmpty(res[0]['IPX_COMMONCODE.FIRSTMENUID'])){
                this.setState({
                    firstMenu: res[0]['IPX_COMMONCODE.FIRSTMENUNM'],
                    secondMenu: res[0]['IPX_COMMONCODE.SECONDMENUNM'],
                    thridMenu: res[0]['IPX_COMMONCODE.THIRDMENUNM']
                  });
                document.getElementById("hideThirdMenu").style.display = "contents"
            }else{
                this.setState({
                    firstMenu: res[0]['IPX_COMMONCODE.SECONDMENUNM'],
                    secondMenu: res[0]['IPX_COMMONCODE.THIRDMENUNM'],
                    thridMenu: null
                  });
                document.getElementById("hideThirdMenu").style.display = "none"
            }
            
            
        })
        .catch(error =>{
           console.error(error);
        })
    }

    render() {
        const { inputValue } = this.state;
        return (
            <OwpDialog
                title="다국어 등록"
                callbackFunction={this.createDialogOpen}
                dialogButton="등록"
                dialogActions={
                    <React.Fragment>
                        <div className="w-full center">
                            <OwpButton color="secondary" variant="contained" onClick={this.clickCreate}>
                            등록
                            </OwpButton>
                            <OwpButton color="secondary" variant="outlined" onClick={this.createDialogClose}>
                            닫기
                            </OwpButton>
                        </div>
                    </React.Fragment>
                }
                innerRef={(ref) => (this.owpDialog = ref)}
                width="800px"
                height="auto"
            >
                <React.Fragment>
                    <Formsy>
                        <div style={{width:'100%'}}>
                            <table className="table table-bordered table-advance tlw5">
                                <tbody>
                                <tr>
                                    <th className="left" width="120">화면ID</th>
                                    <td className="left">
                                        <OwpPresetAutocompleteTextField
                                            className="w-160"
                                            id="PAGEID"
                                            name="PAGEID"
                                            minInputLength={2}
                                            onInputChange={debounce((inputValue) => this.setState({ inputValue }), 300, {
                                              maxWait: 1000,
                                            })}
                                            query={
                                              !isEmpty(this.state.inputValue) && {
                                                url: "/listOwpScreenID",
                                                params: {
                                                  "IPX_COMMONCODE.CODEID": inputValue,
                                                },
                                                item: {
                                                    labelKey: "IPX_COMMONCODE.PAGEID",
                                                    valueKey: "IPX_COMMONCODE.PAGEID"
                                                }
                                              }
                                            }
                                            isMulti={false}
                                            onChange={(value) => {
                                              this.setState({
                                                PAGEID: value["value"],
                                                
                                              });
                                              this.onSearchScreenID(value["value"]);
                                            }}
                                        
                                    />


                                    </td>
                                    <th className="left" width="120">다국어ID<span className ='c04'>*</span></th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{width:'100%'}}
                                            name = "LANGID"
                                            id = "LANGID"
                                        />
                                    </td>
                                            
                                </tr>
                                <tr>
                                    {/* <th className="left" width="120">대메뉴</th> */}
                                    <th className="left" width="120">1st Menu</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{width:'100%'}}
                                            name="FIRSTMENUNM"
                                            id="FIRSTMENUNM"
                                            disabled={true}
                                            value ={this.state.firstMenu}
                                        />
                                    </td>
                                    {/* <th className="left" width="120">소메뉴</th> */}
                                    <th className="left" width="120">2nd Menu</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{width:'100%'}}
                                            name = "SECONDMENUNM"
                                            id = "SECONDMENUNM"
                                            disabled={true}
                                            value ={this.state.secondMenu}
                                        />
                                    </td>
                                   
                                </tr>
                                {/* <div id="hideThirdMenu" style={{ display: "none" }}> */}
                                 <tr  id="hideThirdMenu" style={{ display: "none" }}>
                                 
                                    <th className="left" width="120">3rd Menu</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{width:'100%'}}
                                            name = "THIRDMENUNM"
                                            id = "THIRDMENUNM"
                                            value = {this.state.thridMenu}
                                            disabled={true}
                                        />
                                    </td>
                                 
                                </tr>           
                                {/* </div> */}
                                <tr>
                                    <th className="left">국문</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{width:'100%'}}
